import os
import sys
import base64
import markdown2
noMark = ''
Mark = ''
with open(os.path.join(sys.path[0], "hello.md"), "rb") as f:
    noMark = base64.b64encode(f.read())

with open(os.path.join(sys.path[0], "hello.md"), "r") as f:
    Mark = markdown2.markdown(f.read())
with open(os.path.join(sys.path[0], "lel.txt"), "w") as f:
        f.write(Mark)
with open(os.path.join(sys.path[0], "lel.txt"), "rb") as f:
    Mark = base64.b64encode(f.read())

with open(os.path.join(sys.path[0], "markdownbase64.txt"), "w") as f:
    f.write(Mark)
